import React from "react";
import Menu from "./Menu";

import { Main } from "./Main";
import { About } from "./About";
import Page from "./Page";

import { BrowserRouter as Router, Switch } from "react-router-dom";

function App() {
    return (
        <Router>
            <div className="App">
                <Menu />
                <Switch>
                    <Page exact path="/" component={Main} title="HOME" description="Digital therapeutics for mental healthcare." />
                    <Page exact path="/about" component={About} title="ABOUT" description="A"/>
                </Switch>
            </div>
        </Router>
    );
}

export default App;
